import React, { useState } from 'react';
import './Navbar.module.css'; // Import your CSS file for styling

const Menu = () => {
  const [showSubMenu1, setShowSubMenu1] = useState(false);
  const [showSubMenu2, setShowSubMenu2] = useState(false);

  const toggleSubMenu1 = () => {
    setShowSubMenu1(!showSubMenu1);
    setShowSubMenu2(false);
  };

  const toggleSubMenu2 = () => {
    setShowSubMenu2(!showSubMenu2);
  };

  return (
    <nav className="menu">
      <ul>
        <li>Home</li>
        <li onMouseEnter={toggleSubMenu1} onMouseLeave={toggleSubMenu1}>
          About
          {showSubMenu1 && (
            <ul className="submenu">
              <li>Company</li>
              <li onMouseEnter={toggleSubMenu2} onMouseLeave={toggleSubMenu2}>
                Team
                {showSubMenu2 && (
                  <ul className="submenu">
                    <li>Management</li>
                    <li>Staff</li>
                  </ul>
                )}
              </li>
              <li>History</li>
            </ul>
          )}
        </li>
        <li>Contact</li>
      </ul>
    </nav>
  );
};

export default Menu;
